INSERT INTO `aboutus` (`id`, `section_link`, `section_name`, `visible`, `data`) VALUES
(1, 'preorder', 'Preorder', 'y', '<p>Предзаказ &mdash; это предварительная оплата покупки в нашем магазине. Предзаказ возможен либо до официального начала продаж (и тогда это реальная возможность приобрести игру дешевле стоимости после начала продаж), либо когда контент недоступен (например, в наличии нет необходимых регистрационных ключей). Как только контент поступает в продажу, предварительный заказ превращается в полноценную покупку, и вы получаете соответствующее письмо.</p>\r\n<p>&nbsp;</p>\r\n<p>В описании контента указывается прогнозируемое время его поступления в продажу. Но не забывайте, что правообладатель вправе изменить это время.</p>\r\n<p>&nbsp;</p>\r\n<p>Мы&nbsp;размещаем в&nbsp;своём каталоге только то,&nbsp;о&nbsp;чём имеются договоры или предварительные соглашения с&nbsp;правообладателями. Вы&nbsp;получите то,&nbsp;что заказали, в&nbsp;тот момент, когда оно поступит в&nbsp;продажу в&nbsp;нашем магазине. В&nbsp;случае, если планы правообладателя изменятся и&nbsp;мы&nbsp;не&nbsp;сможем предоставить вам заказанный товар, мы&nbsp;обязательно вас оповестим и&nbsp;начислим на&nbsp;ваш счёт сумму в&nbsp;бонус очках, эквивалентную стоимости предзаказа.</p>'),
(2, 'bonus_points', 'Bonus Points', 'y', '<p>Система наших бонусов &ndash; это одна из самых веских причин, почему стоит зарегистрироваться и покупать игры на Game4.pro. Ведь у нас вы не просто покупаете игры, но и получаете за это бонус очки, которые вы потом так же можете использовать для покупки новых игр.</p>\r\n<p>Зарегестрируйтесь, оформите у нас одну покупку и вы получите не только бонус очки которые идут с каждой игрой, но и подарок от нас - <strong>Всем покупателям оформившим свой первый заказ - 10 бонус очков.</strong></p>\r\n<p><strong><br /></strong>Копите свои бонус очки и покупайте на них всё больше и больше игр у нас !</p>\r\n<p>1 бонус очко = 0.10 Евро</p>'),
(8, 'purchase', 'Purchases', 'y', '<p>Предзаказ &mdash; это предварительная оплата покупки в нашем магазине. Предзаказ возможен либо до официального начала продаж (и тогда это реальная возможность приобрести игру дешевле стоимости после начала продаж), либо когда контент недоступен (например, в наличии нет необходимых регистрационных ключей). Как только контент поступает в продажу, предварительный заказ превращается в полноценную покупку, и вы получаете соответствующее письмо.</p>\r\n<p>&nbsp;</p>\r\n<p>В описании контента указывается прогнозируемое время его поступления в продажу. Но не забывайте, что правообладатель вправе изменить это время.</p>\r\n<p>&nbsp;</p>\r\n<p>Мы&nbsp;размещаем в&nbsp;своём каталоге только то,&nbsp;о&nbsp;чём имеются договоры или предварительные соглашения с&nbsp;правообладателями. Вы&nbsp;получите то,&nbsp;что заказали, в&nbsp;тот момент, когда оно поступит в&nbsp;продажу в&nbsp;нашем магазине. В&nbsp;случае, если планы правообладателя изменятся и&nbsp;мы&nbsp;не&nbsp;сможем предоставить вам заказанный товар, мы&nbsp;обязательно вас оповестим и&nbsp;начислим на&nbsp;ваш счёт сумму в&nbsp;бонус очках, эквивалентную стоимости предзаказа.</p>'),
(9, 'help', 'Help', 'n', '<p><strong>Что делать, если при попытке активации игры через Steam, вы видите сообщение о неправильном регионе?</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Для активации игры Вам надо зайти в интернет через VPN-сервис, для этого нужно сделать следующее:</p>\r\n<p>1) Зайти на сайт <a href="http://incloak.com/vpn/">http://incloak.com/vpn/</a> и там оформить бесплатный тестовый доступ на 1 сутки, и получить необходимые для работы ключи.</p>\r\n<p>2) Следуя инструкциям на сайте, скачать, установить и настроить программу OpenVPN, и выйти через неё в интернет.</p>\r\n<p>3) Установить игру с диска или активировать Вашу копию игры через Steam: всё должно работать.</p>\r\n<p>В дальнейшем Вы можете играть как обычно, не используя программу OpenVPN (она требуется ТОЛЬКО ДЛЯ АКТИВАЦИИ игры).</p>\r\n<p>Инструкция подходит для следующих игр: Dead Island, Hard Reset, Football Manager 2012, Stronghold 3. (при обнаружении проблем с другими играми, список будет дополняться)</p>'),
(11, '', 'About Us', 'y', 'ABOUT US');
