INSERT INTO `disclaimers` (`id`, `txt_en`, `txt_ru`) VALUES
('preorder', '<p>Сейчас среди бесчисленного множества компьютерных игр можно запросто потеряться. Но PRO-геймеры хорошо знают, что в каждом жанре есть свои неоспоримые лидеры. Считаете себя PRO-геймером? Тогда вам стоит посетить Game4.pro, где вы без труда найдете самые актуальные игровые новинки. Если же вы еще новичок в мире игр, то вам непременно стоит обратить свое внимание на Game4.pro, где собраны лучшие хиты игрового мира, поэтому любой выбор будет удачным.</p>\r\n<p>&nbsp;</p>\r\n<p>Мы предлогаем:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Широкий ассортимент игр на любой вкус</li>\r\n<li>Гарантированное качество всех товаров</li>\r\n<li>Удобные способы оплаты</li>\r\n<li>Моментальная доставка товаров</li>\r\n<li>Внимательное и лояльное отношение к клиентам</li>\r\n<li>Система бонусов и вознаграждений.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Мы являемся официальным партнёром компаний ElectronicArts, Blizzard, Activision, Ubisoft и т.д.</p>\r\n<p>Мы всегда держим руку на пульсе, поэтому у нас вы можете найти самые горячие новинки.</p>\r\n<p>Game4.pro дорожит своими клиентами, поэтому в наш каталог попадают только лицензионные ключи активации.</p>', ''),
('bonuses', '<p>Система наших бонусов &ndash; это одна из самых веских причин, почему стоит зарегистрироваться и покупать игры на Game4.pro. Ведь у нас вы не просто покупаете игры, но и получаете за это бонус очки, которые вы потом так же можете использовать для покупки новых игр.</p>\n<p>Зарегестрируйтесь, оформите у нас одну покупку и вы получите не только бонус очки которые идут с каждой игрой, но и подарок от нас - <strong>Всем покупателям оформившим свой первый заказ - 10 бонус очков.</strong></p>\n<p><strong><br /></strong>Копите свои бонус очки и покупайте на них всё больше и больше игр у нас !</p>\n<p>1 бонус очко = 0.10 Евро</p>', ''),
