('help2', '<p><strong>Итак рассмотрим более подробно как пользоваться программой </strong><strong>OpenVPN</strong><strong> и активировать через неё игры не доступные в вашем регионе:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>1) Заходим на сайт <a href="http://incloak.com/vpn/">http://incloak.com/vpn/</a> и там оформляем бесплатный тестовый доступ на 1 сутки, и получаем на свой мейл необходимые для работы ключи.</p>\r\n<p>&nbsp;</p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="https://dl.dropbox.com/u/94912497/VPNhelp1.jpg" alt="" width="500" height="539" /></p>', '');
