(41, 'Call of Duty: Black Ops 2', '', '13/11/2012', '', 'PC', '', 'English, Deutsch, Español, Français, Italiano', '', 47.99, 63.49, 39.49, 1999.00, '&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;h2&amp;gt;About This Game&amp;lt;/h2&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;span&amp;gt;Summary:&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;img src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_m.gif&amp;quot; style=&amp;quot;float: left;&amp;quot; /&amp;gt;An entry into the blockbuster first-person shooter franchise, Call of Duty: Black Ops II brings players back into the shadows for another Black Ops mission assignment. Rooted in near-future fiction, Black Ops II propels players into warfare in an epic single player campaign highlighted by branching storylines and non-linear missions. A re-imagined multiplayer suite introduces players to some of the most cutting-edge weaponry and equipment that 2025 will have to offer. And on the outskirts of the campaign is an all-new Zombies experience running in the multiplayer engine.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;span&amp;gt;Features:&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;&amp;lt;span&amp;gt;All-New Create-A-Class: Create-a-class has been re-imagined, introducing players to a new &amp;quot;pick-10&amp;quot; allocation system, allowing an unprecedented number of combinations of create-a-class content. Players no longer have to take content from each category; instead, trade items from one category for extra items in another -- any combination of 10 items makes almost anything possible.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;&amp;lt;span&amp;gt;New Score Streaks: Score Streaks reward players for helping their team win the game: capturing flags, defending your teammate with an assault shield, getting kills and assists are all examples of actions that help your team win and thus give you score. Each action has a different value and can influence the theater of operations.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;&amp;lt;span&amp;gt;eSports via League Play: COD: BO2 introduces League Play, offering skill-based matchmaking and seasonal ladders. Play a small number of matches to get your skill rating, and from there, you''ll be placed into a division with players of similar skill. Keep winning and you''ll move up in rank -- steady progress will move you up the ladder and into upper divisions. Skill-based matchmaking ensures that you are challenged but not out-gunned. League play is for everyone. Additionally, CODcasting is part of the mix, allowing fans to commentate their favorite games.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;&amp;lt;span&amp;gt;Upgraded Weapons, Attachments and Equipment: Near-future warfare means upgrades in technology that soldiers will use in the field. Additionally, weapon perks are now built into the attachments.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Publisher&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.activision.com/&amp;quot;&amp;gt;Activision&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Developer&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.treyarch.com/&amp;quot;&amp;gt;Treyarch&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;', '&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;The Setting...&amp;lt;strong&amp;gt;&amp;lt;img title=&amp;quot;callofduty-black-ops2_5&amp;quot; src=&amp;quot;http://www.buygamecode.com/blog/wp-content/uploads/2012/07/callofduty-black-ops2_5.jpg&amp;quot; style=&amp;quot;float: right;&amp;quot; /&amp;gt;&amp;lt;/strong&amp;gt;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;The game continues the tale of Frank Woods, hero of the original Black Ops, as well as various members of the Mason family. The action largely takes place in the year 2025, where a new Cold War is raging and the tools of war have been suitably upgraded, with battle drones on land and in the air, and an arsenal that packs a larger, more accurate punch than the weapons of today.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;The historical battles of the original Black Ops do still make an appearance, with events spanning from 1980''s Afghanistan right through to the near-future war. Different generations of the Mason family will fight in different eras, but all the missions seem to centre around one man - the new, mysterious villain Raul Menendez.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;The Gameplay...&amp;lt;a href=&amp;quot;http://www.buygamecode.com/blog/wp-content/uploads/2012/07/callofduty-black-ops_4.jpg&amp;quot;&amp;gt;&amp;lt;img title=&amp;quot;callofduty-black-ops_4&amp;quot; src=&amp;quot;http://www.buygamecode.com/blog/wp-content/uploads/2012/07/callofduty-black-ops_4.jpg&amp;quot; style=&amp;quot;float: right;&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Call of Duty: Black Ops II promises some big shifts to the traditional Call of Duty gameplay. The campaign mode now features non-linear and branching storylines, where the decisions you make and actions you take informing how the game plays out. Whether it''s choosing one option over another, or simply failing to save a single hostage, all your actions have consequences - the biggest one being you can play the game time and again to see the different outcomes unfold!&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Add to this more options for how you battle, with the ''run and gun'' approach now joined by the chance to drive cars, man gun turrets, ride horses and fly fighter jets. There''s also the new Strike Force mode, open-world missions with a series of checkpoints to achieve and the chance to swap between characters - including playing as an all-controlling general. It''s like an open-world sandbox, a real-time strategy and a multiplayer map all in one - and it can also affect the outcome of the game!&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n&amp;lt;/div&amp;gt;', '&amp;lt;em&amp;gt;Minimum System Requirements:&amp;lt;/em&amp;gt;\r\nOS: Windows Vista SP2 or Windows 7\r\nProcessor: Intel Core2 Duo E8200 2.66 GHz or AMD Phenom X3 8750 2.4 GHz\r\nMemory: 2GB for 32-bit OS or 4GB for 64-bit OS\r\nVideo Card: Nvidia GeForce 8800GT 512 MB or ATI Radeon HD 3870 512 MB', '', 18, 'Action,Shooter', 'F6vOWbJ46XU', 'uEeS4--TWyw', '', '4908.jpg\n1099.jpg\n6837.jpg\n9306.jpg\n2000.jpg\n7256.jpg\n2541.jpg\n6930.jpg\n6455.jpg\n', '6455.jpg', 10, 'y'),
(42, 'Diablo 3 ', '', '15/05/2012', '', 'PC', '', 'English, Deutsch, Español, Français, Русский, Polski, Italiano', '', 49.95, 65.95, 40.95, 0.00, '&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;font-size: large;&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;About This Game&amp;lt;/strong&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Summary:&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;img src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_m.gif&amp;quot; style=&amp;quot;float: left;&amp;quot; /&amp;gt;Diablo III picks up the story twenty years after the events of Diablo II. Mephisto, Diablo, and Baal have been defeated, but the Worldstone, which once shielded the inhabitants of the world of Sanctuary from the forces of both Heaven and Hell, has been destroyed, and evil once again stirs in Tristram. Playing as a hero from one of five distinct character classes, players will acquire powerful items, spells, and abilities as they explore new and familiar areas of Sanctuary and battle hordes of demons to safeguard the world from the horrors that have arisen.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Features:&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul class=&amp;quot;featureList&amp;quot;&amp;gt;\r\n&amp;lt;li&amp;gt;Five powerful character classes to choose from, including the barbarian and witch doctor&amp;lt;/li&amp;gt;\r\n&amp;lt;li&amp;gt;Brand-new 3D graphics engine enhanced with spectacular visual effects and Havok physics&amp;lt;/li&amp;gt;\r\n&amp;lt;li&amp;gt;Numerous indoor and outdoor areas detailing new regions in the world of Sanctuary&amp;lt;/li&amp;gt;\r\n&amp;lt;li&amp;gt;Interactive environments with dangerous traps and obstacles, and destructible elements&amp;lt;/li&amp;gt;\r\n&amp;lt;li&amp;gt;Randomly generated worlds bolstered by scripted events for endless and dynamic gameplay&amp;lt;/li&amp;gt;\r\n&amp;lt;li&amp;gt;Vast assortment of fiendish monsters, with unique attack patterns and behaviors&amp;lt;/li&amp;gt;\r\n&amp;lt;li&amp;gt;New quest system and character-customization options for the ultimate action RPG experience&amp;lt;/li&amp;gt;\r\n&amp;lt;li&amp;gt;Multiplayer functionality over Battle.net&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Publisher&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.blizzard.com/&amp;quot;&amp;gt;Blizzard Entertainment&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Developer&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.blizzard.com/&amp;quot;&amp;gt;Blizzard Entertainment&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;', '', '&amp;lt;em&amp;gt;System Requirements:&amp;lt;/em&amp;gt;\r\nOS: XP, Vista, 7, Mac OS\r\nProcessor: Intel Core 2 Duo\r\nMemory: 1 GB\r\nVideo Card: Nvidia GeForce 7800 / Radeon ATI Radeon X1950 Pro', '', 15, 'RPG', 'UPZJXR5ejQg', 'watU2OILZlk', '', '6545.jpg\n4627.jpg\n6951.jpg\n2762.jpg\n1940.jpg\n6375.jpg\n3886.jpg\n2570.jpg\n6861.jpg\n', '6861.jpg', 15, 'y'),
(43, 'Borderlands 2', '', '18/09/2012', '', 'PC', '', 'English, Deutsch, Español, Français, Русский, Italiano', '', 14.49, 18.99, 11.99, 0.00, '&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Attention !&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;lt;span&amp;gt;This is a official Activation Code / CD Key / Serial for Borderlands 2.&amp;lt;/span&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;span&amp;gt;This is an activation code which will allow you to legally activate, download and play the game via Steam.&amp;lt;/span&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;../../../help2&amp;quot;&amp;gt;&amp;lt;em&amp;gt;Please note! Using RU VPN key takes additional effort and time from you. Click for details look at example of activation&amp;lt;/em&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;contentModule-header&amp;quot;&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;h2&amp;gt;About This Game&amp;lt;/h2&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;div class=&amp;quot;aboutGame clear&amp;quot;&amp;gt;\r\n&amp;lt;p class=&amp;quot;ign-tab selected&amp;quot; data-tab=&amp;quot;#summary&amp;quot;&amp;gt;Summary:&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;div id=&amp;quot;summary&amp;quot; class=&amp;quot;ign-tabContent&amp;quot;&amp;gt;\r\n&amp;lt;div class=&amp;quot;gameInfo&amp;quot;&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;img class=&amp;quot;ratingImage&amp;quot; src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_m.gif&amp;quot; style=&amp;quot;float: left;&amp;quot; /&amp;gt;Borderlands 2 is the epic sequel to the ultimate four-player role-playing shooter loot fest. Combining invention and evolution, Borderlands 2 features mixed online/split-screen co-op, all-new characters, skills, environments, enemies, weapons and equipment, which come together in an ambitiously crafted story. Players will reveal secrets, and escalate mysteries of the Borderlands universe as they adventure across the unexplored new areas of Pandora.&amp;lt;/p&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp; &amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n&amp;lt;p class=&amp;quot;ign-tab selected&amp;quot; data-tab=&amp;quot;#features&amp;quot;&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p class=&amp;quot;ign-tab selected&amp;quot; data-tab=&amp;quot;#features&amp;quot;&amp;gt;Features:&amp;lt;/p&amp;gt;\r\n&amp;lt;p class=&amp;quot;ign-tab selected&amp;quot; data-tab=&amp;quot;#features&amp;quot;&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;All-New Characters and Classes: Choose from all new characters and classes including the Gunzerker, who can dual-wield any two weapons in the game. Dual machine guns? Cool. Dual rocket launchers? Of course! Dual Sniper Rifles? Sure, if that''s your thing! More tactical perhaps? There are multiple classes to choose from!&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;Play Online with Friends: Share your adventures with friends through a seamless system enabling you to drop in and drop out of a campaign without ever having to restart the game.&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;World Connected Story: Left for dead in the frozen tundra of Pandora, begin your quest of revenge and redemption as the story drives you closer to the Hyperion Corporation and its evil founder, Handsome Jack.&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;New Badass Gun System: Millions upon millions of possible weapons means tons of new and innovative ways to engage foes on Pandora. Fire, electricity, corrosive acid, and more will all be at your disposal.&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;87 Bazillion...Everything: It''s not just guns on Pandora, you will lust after procedurally generated shields,grenades, alien artifacts, class mods and much, much more.&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;Brand new environments: From the arctic tundra, through the dangerous grasslands, past the mysterious corrosive caverns to beyond, discover more of the unpredictable world of Pandora at every turn!&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n&amp;lt;li&amp;gt;Brand new enemies: Hulking, gorilla-like Bullymongs, vicious predatory Stalkers and the Hyperion mechanical army, run by Handsome Jack, are just some of the new enemies you will face.&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Publisher&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.2kgames.com/&amp;quot;&amp;gt;2K Games&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Developer&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.gearboxsoftware.com/&amp;quot;&amp;gt;Gearbox Software&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;', '', '&amp;lt;em&amp;gt;Minimum System Requirements:&amp;lt;/em&amp;gt;\r\nOS: XP, Vista, 7, Mac OS\r\nCPU: Intel Core 2 Duo, 2.4 GHz \r\nMemory: 2 GB\r\nVideo: Nvidia GeForce 8600 / Radeon HD 2600 256 MB', '', 18, 'Action,RPG,Shooter', 'OfsfRFtui7o', '', '', '4568.jpg\n7773.jpg\n7304.jpg\n3509.jpg\n8572.jpg\n3967.jpg\n5647.jpg\n9895.jpg\n5767.jpg\n', '5767.jpg', 5, 'y'),
(173, 'Lost Planet 3 : Steam CD Keys', '', '28/01/2013', '', 'PC', '', 'English, Русский', '', 35.99, 45.99, 29.99, 0.00, '&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;http://www.ign.com/esrb.html#RP-T+&amp;quot;&amp;gt;&amp;lt;img class=&amp;quot;ratingImage&amp;quot; src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_rp-t+.gif&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;Lost Planet 3 reveals new truths about the foreboding planet and the colonial history of E.D.N. III, returning players to the extreme and unpredictable conditions that characterized the Lost Planet series, now harsher than ever before. The game delivers a diverse range of gameplay including on-foot battles and intense first person action. With a number of multiplayer modes and a compelling single player experience, Lost Planet 3 will delved into the hidden truths within the unique and dynamic environment of E.D.N. III.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Lost Planet 3 introduces Jim, a rig pilot who leaves Earth to take on a hazardous but lucrative contract on E.D.N. III working for Neo-Venus Construction (NEVEC.) NEVEC''s existing Thermal Energy reserve is running low, and the fate of the Coronis mission depends on the natural source of the energy supply being located. Realizing the opportunity for a huge pay-off and early ticket home, Jim braves the risk of the treacherous environment and threat of the indigenous Akrid. Acting as a home away from home and boasting an array of tools that can assist Jim on the field, the utility rig provides Jim''s safety and is essential for not only his contract work but also his protection against the ever-changing climate.&amp;lt;/p&amp;gt;', '{"eur":"","usd":"","rub":null,"gbp":""}', 'This is a official Activation Code / CD Key / Serial for Lost Planet 3. This is an activation code which will allow you to legally activate, download and play the game via Steam.', '', 16, 'Action', 'NhH0w0u8x30', '', '', '7688.jpg\n4876.jpg\n', '7688.jpg', 10, 'y'),
(45, 'Crysis 3', '', '28/02/2014', '', 'PC', '', 'English, Русский', '', 36.00, 47.00, 30.00, 0.00, '&amp;lt;div class=&amp;quot;contentModule-header&amp;quot;&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;h2&amp;gt;About This Game&amp;lt;/h2&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;div class=&amp;quot;aboutGame clear&amp;quot;&amp;gt;\r\n&amp;lt;p class=&amp;quot;ign-tab selected&amp;quot; data-tab=&amp;quot;#summary&amp;quot;&amp;gt;Summary:&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;div id=&amp;quot;summary&amp;quot; class=&amp;quot;ign-tabContent&amp;quot;&amp;gt;\r\n&amp;lt;div class=&amp;quot;gameInfo&amp;quot;&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;img class=&amp;quot;ratingImage&amp;quot; src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_rp-m+.gif&amp;quot; style=&amp;quot;float: left;&amp;quot; /&amp;gt;The hunted becomes the hunter in the CryEngine-powered open-world shooter Crysis 3! Players take on the role of ''Prophet'' as he returns to New York in the year in 2047, only to discover that the city has been encased in a Nanodome created by the corrupt Cell Corporation. The New York City Liberty Dome is a veritable urban rainforest teeming with overgrown trees, dense swamplands and raging rivers. Within the Liberty Dome, seven distinct and treacherous environments become known as the Seven Wonders. This dangerous new world demands advanced weapons and tactics. Prophet will utilize a lethal composite bow, an enhanced Nanosuit and devastating alien tech to become the deadliest hunter on the planet.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Prophet is on a revenge mission after uncovering the truth behind Cell Corporation''s motives for building the quarantined Nanodomes. The citizens were told that the giant citywide structures were resurrected to protect the population and to cleanse these metropolises of the remnants of Ceph forces. In reality, the Nanodomes are CELL''s covert attempt at a land and technology grab in their quest for global domination. With Alien Ceph lurking around every corner and human enemies on the attack, nobody is safe in the path of vengeance. Everyone is a target in Prophet''s quest for retribution.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Publisher&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://games.ign.com/objects/025/025025.html&amp;quot;&amp;gt;Electronic Arts&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Developer&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://games.ign.com/objects/027/027579.html&amp;quot;&amp;gt;Crytek Studios&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;', '{"eur":"38","usd":"50","rub":null,"gbp":"35"}', '&amp;lt;em&amp;gt;Minimum System Requirements:&amp;lt;/em&amp;gt;	\r\nOS: Vista, 7, Windows 8\r\nProcessor: Intel Core 2 Duo, 2.4 GHz\r\nMemory: 3 GB\r\nVideo Card: Nvidia GeForce GTS 450 1024 MB', '', 16, 'Action,Shooter', 'RV1TJpz9544', 'GEvCpWaGYsY', '', '1879.jpg\n7086.jpg\n6442.jpg\n8237.jpg\n6360.jpg\n4215.jpg\n3692.jpg\n6963.jpg\n8789.jpg\n', '8789.jpg', 10, 'y'),
(49, 'Crysis 2', '', '22/03/2011', '', 'PC', '', 'English, Русский', '', 9.95, 13.15, 8.15, 0.00, '&amp;lt;h2&amp;gt;About This Game&amp;lt;/h2&amp;gt;\r\n&amp;lt;img src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_rp-m+.gif&amp;quot; width=&amp;quot;55&amp;quot; height=&amp;quot;76&amp;quot; style=&amp;quot;float: left; margin-right: 5px;&amp;quot; /&amp;gt;The hunted becomes the hunter in the CryEngine-powered open-world shooter Crysis 3! Players take on the role of ''Prophet'' as he returns to New York in the year in 2047, only to discover that the city has been encased in a Nanodome created by the corrupt Cell Corporation. The New York City Liberty Dome is a veritable urban rainforest teeming with overgrown trees, dense swamplands and raging rivers. Within the Liberty Dome, seven distinct and treacherous environments become known as the Seven Wonders. This dangerous new world demands advanced weapons and tactics. Prophet will utilize a lethal composite bow, an enhanced Nanosuit and devastating alien tech to become the deadliest hunter on the planet.&amp;amp;nbsp;&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;Prophet is on a revenge mission after uncovering the truth behind Cell Corporation''s motives for building the quarantined Nanodomes. The citizens were told that the giant citywide structures were resurrected to protect the population and to cleanse these metropolises of the remnants of Ceph forces. In reality, the Nanodomes are CELL''s covert attempt at a land and technology grab in their quest for global domination. With Alien Ceph lurking around every corner and human enemies on the attack, nobody is safe in the path of vengeance. Everyone is a target in Prophet''s quest for retribution.&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;Publisher:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://games.ign.com/objects/025/025025.html&amp;quot; target=&amp;quot;_blank&amp;quot;&amp;gt;Electronic Arts&amp;lt;/a&amp;gt;&amp;amp;nbsp;&amp;lt;br /&amp;gt;Developer:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://games.ign.com/objects/027/027579.html&amp;quot; target=&amp;quot;_blank&amp;quot;&amp;gt;Crytek Studios&amp;lt;/a&amp;gt;', '', '&amp;lt;em&amp;gt;System Requirements:&amp;lt;/em&amp;gt;\r\nOS:	 XP, Vista, 7\r\nCPU:	 Intel Core 2 Duo, 2 GHz\r\nMemory:	 2 GB\r\nVideo: Nvidia GeForce 8800 / Radeon 3850HD 512 MB', '', 16, 'Action,Shooter', 'i-msMHj_ZGc', '9uHNUBvSa9k', '', '4123.jpg\n2033.jpg\n9704.jpg\n3476.jpg\n4372.jpg\n5569.jpg\n2991.jpg\n4968.jpg\n1682.jpg\n', '1682.jpg', 0, 'y'),
(48, 'Guild Wars 2', '', '28/08/2012', '', 'PC', '', 'English, Deutsch, Français', '', 38.49, 50.99, 31.55, 0.00, '&amp;lt;div class=&amp;quot;contentModule-header&amp;quot;&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;h2&amp;gt;About This Game&amp;lt;/h2&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;div class=&amp;quot;aboutGame clear&amp;quot;&amp;gt;\r\n&amp;lt;p class=&amp;quot;ign-tab selected&amp;quot; data-tab=&amp;quot;#summary&amp;quot; style=&amp;quot;text-align: left;&amp;quot;&amp;gt;Summary:&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;div id=&amp;quot;summary&amp;quot; class=&amp;quot;ign-tabContent&amp;quot;&amp;gt;\r\n&amp;lt;div class=&amp;quot;gameInfo&amp;quot;&amp;gt;\r\n&amp;lt;p style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;a href=&amp;quot;http://www.ign.com/esrb.html#T&amp;quot;&amp;gt;&amp;lt;img class=&amp;quot;ratingImage&amp;quot; src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_t.gif&amp;quot; style=&amp;quot;float: left;&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;amp;nbsp; &amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;For generations, war and chaos raged across the land of Tyria. Five great races competed and warred against each other, &amp;amp;nbsp; &amp;lt;br /&amp;gt;struggling to tip the balance of power in their favor.&amp;amp;nbsp;Then the dragons woke.&amp;amp;nbsp;The all-powerful beasts stirred from their &amp;amp;nbsp;millennial sleep under earth and sea. With their magical breath the dragons spread destruction and created legions of twisted slaves. A deathless dragon named Zhaitan raised the sunken nation of Orr, triggering earthquakes and tidal waves that destroyed entire cities across the Sea of Sorrows. Zhaitan''s undead armies surged from the sea, hungry for the destruction of the five races of Tyria: the charr, a ferocious race of feline warriors; the asura, magical inventors of small size and great intellect; the norn, towering shapeshifters from the frigid northern lands; the sylvari, a mysterious young race of visionary plant folk; and the humans, an embattled but resilient people.&amp;lt;/p&amp;gt;\r\n&amp;lt;p style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;br /&amp;gt;Now heroes from the five races must set aside ancient rivalries and stand together against their common enemies in the sequel to the hit MMO Guild Wars. Magic, technology, and cold steel will determine the ultimate fate of the world.&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;Features:&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Enter an Ever-Changing World -- The living world of Guild Wars 2 is filled with thousands of dynamic events that constantly change based on the actions of players like you. You never know what you&amp;amp;rsquo;ll discover when you log in!&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;gameInfo&amp;quot;&amp;gt;Action-Oriented Combat -- Experience a new kind of high-impact, fast-paced combat. Attack on the move, dodge and roll away from enemy blows, team up with other players, and take advantage of environmental weapons to dominate the battlefield!&amp;lt;/div&amp;gt;\r\n&amp;lt;div class=&amp;quot;gameInfo&amp;quot;&amp;gt;It''s Your Story -- Guild Wars 2 is YOUR story. Your choices determine how your personal story evolves. with thousands of possible variations, no two players will have the exact same experience.&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;/div&amp;gt;\r\nCompetitive Play for Everyone -- Competitive play in Guild Wars 2 is easy to learn, but offers challenges for new players and hardcore PvPers alike. In Player vs. Player matches, small teams of players battle over maps packed with objectives, while in World vs. World, armies of hundreds of players from competing servers wage war across four sprawling maps.&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Publisher&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.ncsoft.net/&amp;quot;&amp;gt;NCsoft&amp;lt;br /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;div style=&amp;quot;text-align: left;&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Developer&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.arena.net/&amp;quot;&amp;gt;ArenaNet&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;', '', 'System Requirements:\r\nOS: XP, Vista, 7\r\nProcessor: Intel Core 2 Duo, 2 GHz\r\nMemory: 2 Gb\r\nVideo Card: Nvidia GeForce 7800 / Radeon X1800 256 MB', '', 12, 'MMORPG', 'o4R5Q0ZOTa8', 'GH7k-6ZdQWA', '', '7744.jpg\n2113.jpg\n5489.jpg\n8042.jpg\n1053.jpg\n6882.jpg\n4780.jpg\n8683.jpg\n5123.jpg\n', '5123.jpg', 10, 'y'),
(170, 'Sleeping Dogs', '', '17/08/2012', '', 'PC', '', 'English, Русский', '', 13.49, 17.75, 10.99, 0.00, '&amp;lt;div class=&amp;quot;contentModule-header&amp;quot;&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;h2&amp;gt;About This Game&amp;lt;/h2&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;div class=&amp;quot;aboutGame clear&amp;quot;&amp;gt;\r\n&amp;lt;p class=&amp;quot;ign-tab selected&amp;quot; data-tab=&amp;quot;#summary&amp;quot;&amp;gt;&amp;lt;span&amp;gt;Summary:&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n&amp;lt;div id=&amp;quot;summary&amp;quot; class=&amp;quot;ign-tabContent&amp;quot;&amp;gt;\r\n&amp;lt;div class=&amp;quot;gameInfo&amp;quot;&amp;gt;\r\n&amp;lt;p&amp;gt;&amp;lt;img src=&amp;quot;http://media.ignimgs.com/media/ign/images/esrb_m.gif&amp;quot; style=&amp;quot;float: left;&amp;quot; /&amp;gt;Inspired by classic Hollywood and Asian cinema style action thrillers, Sleeping Dogs is a gritty open-world cop drama set in the vibrant city of Hong Kong. Sleeping Dogs catapults players into the role of undercover cop Wei Shen, tasked with taking down one of the world&amp;amp;rsquo;s most fearsome criminal organizations from the inside... the Hong Kong Triads. As players explore the bustling and crowded Hong Kong island, through its neon-lit side streets and sprawling street markets, an incredible story unfolds of loyalty and betrayal where Wei begins to question his own motives as he is sucked in deeper than he could ever imagine.&amp;lt;br /&amp;gt;&amp;lt;br /&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Offering players an island packed with action, every street corner, market stall, harbor dock or city skyscraper can become an opportunity for intense shoot-outs, adrenaline-fueled street races and intense, brutal martial arts combat. Featuring one of the most intuitive and imaginative combat systems, Sleeping Dogs empowers players to perform an extensive set of martial arts moves, singlehandedly taking on numerous opponents. Players perform bone-crunching kicks and combos, vicious counters and a cinematic set of environmental takedowns making use of countless real-world items from circular saws to phone booths, incinerators to refrigerator doors.&amp;lt;/p&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Publisher&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.square-enix.com/&amp;quot;&amp;gt;Square Enix&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;&amp;lt;strong&amp;gt;Developer&amp;lt;/strong&amp;gt;:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://www.unitedfrontgames.com/&amp;quot;&amp;gt;United Front Games&amp;lt;/a&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;', '', '&amp;lt;em&amp;gt;Minimum System Requirements:&amp;lt;/em&amp;gt;\r\nOS: Windows Vista или Windows 7 \r\nProcessor: Core 2 Duo 2.4 GHz / Althon X2 2.7 GHz \r\nMemory: 2GB \r\nVideo Card:  ATI Radeon 3870  / Nvidia GeForce 8800 GT 512 MB ', '', 18, 'Action', 'G5QmErybllc', '', '', '4046.jpg\n6550.jpg\n1585.jpg\n8466.jpg\n3763.jpg\n6230.jpg\n1716.jpg\n7963.jpg\n2870.jpg\n', '2870.jpg', 5, 'y'),
