(3, 'Password Change @ Game4pro successful', '', 'Hello [name]!\r\n\r\nYour new password is: [password]', 'Hello [name]!\r\n\r\nYour new password is: [password]', '{"name":{"datatype":"sql","data":{"table":"users","field":"name","=email":"email"}},"password":{"datatype":"vars","data":"password"}}', 'GamePro-Action: Password_remind', 'new_password', 'Password Recovery'),
(4, 'New Game @game4pro', '', 'Hello [name]!\r\n\r\nnew game [game] has been added to our product list, please use [link] to view it.', 'Hello [name]!\r\n\r\nnew game [game] has been added to our product list, please use [link] to view it.', '{"name":{"datatype":"sql","data":{"table":"users","field":"name","=id":"userid"}},"game":{"datatype":"vars","data":"game_id"},"link":{"datatype":"vars","data":"link"}}', 'GamePro-Action: Game-News', 'new_game', 'Announcing New Game'),
(5, 'Tavs pasūtījums', '', 'Hello [name]!\r\n\r\nPlease aktivate ar pin: [pin]', 'Hello [name]!\r\n\r\nPlease aktivate ar pin: [pin]', '{"name":{"datatype":"vars","data":"name"},"pin":{"datatype":"vars","data":"pin"}}', 'GamePro-Action: pin-activation', 'sendPIN', 'Pin sending message'),
(6, 'Tavs pasūtījums', '', 'Hello [name]!\r\ncc_approval_code = ХХХХХХ\r\nPin mozhno poluchitj posmotrev v internet banke opisanije plotezha ilji pozvonjiv v bank !', 'Hello [name]!\r\n\r\nPinu var dabūt zvanot uz banku, vai internetbankā', '{"name":{"datatype":"vars","data":"name"}}', 'GamePro-Action: pin-activation', 'sendPINInfo', 'Inform where to find PIN');
